        VAR_CANT_DIAS,
        VAR_COST_TOTAL,
        VAR_PESO_V_TOTAL,
        VAR_FECH_DIGI,
        VAR_USU_DIGI,
        VAR_COD_ESTA
      );

    ELSE

      INSERT INTO fac_guia_detal (
        COD_GUIA_DETAL,
        FAC_COD_GUIA,
        COD_CATG,
        COD_MAE_PRODU,
        NUM_PROD,
        DESC_CORTAR,
        PREC_X_DIA,
        PESO_REAL,
        PESO_VOL,
